import React, { useState } from 'react';
import './Recents.css';
import { FaExternalLinkAlt, FaClipboard } from 'react-icons/fa';

const Recents = () => {
  const [projects, setProjects] = useState([]); // Başlangıçta proje yok

  const addProject = () => {
    // Yeni proje eklemek için işlev
    const newProject = { id: 1, name: 'New Project' };
    setProjects([newProject]); // Yeni proje ekle
  };

  return (
    <div className="recents-container">
      <h2>Recents</h2>
      {projects.length === 0 ? (
        <div className="no-project">
          <p>No recent projects available.</p>
          <button className="add-project-btn" onClick={addProject}>
            + Create New Project
          </button>
        </div>
      ) : (
        <div className="recents-list">
          {projects.map((project) => (
            <div key={project.id} className="recent-item">
              <span>{project.name} • in Project Notes</span>
              <div className="project-icons">
                <button
                  className="icon-btn"
                  title="Open in new tab"
                  onClick={() => alert('Opening project in new tab...')}
                >
                  <FaExternalLinkAlt />
                </button>
                <button
                  className="icon-btn"
                  title="Copy link"
                  onClick={() => alert('Link copied!')}
                >
                  <FaClipboard />
                </button>
              </div>
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

export default Recents;
